// HasPanels applies the HasEdge predicate on the "panels" edge.
func HasPanels() predicate.Env {
	return predicate.Env(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2M, false, PanelsTable, PanelsPrimaryKey...),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasPanelsWith applies the HasEdge predicate on the "panels" edge with a given conditions (other predicates).
func HasPanelsWith(preds ...predicate.Panel) predicate.Env {
	return predicate.Env(func(s *sql.Selector) {
		step := newPanelsStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

